BABEL LOUK\r\nCAIRO, EGYPT\r\nTEL:   +202 2796 1121\r\nFAX:  +202 2796 3451\r\n','2018-07-17 13:43:22','2018-07-17 13:43:22','8519e75c-ebb2-4b46-a594-920fc4fda110'),(15,230,'en','James Freestone - Thu, 19 Jul 2018 08:08',NULL,'James','Freestone',NULL,'Jimfreestone@becdmia.co.om','+968 99238393',NULL,NULL,NULL,'Dear Sir,\r\nMay I introduce myself, I am the commissioning manager for the Bechtel-Enka-BEC consortium building the Muscat International Airport, on which several of your products are used. Preparation of  the operating and maintenance manuals require Victoria Fans installation and maintenance information that we do not have. \r\n\r\nWould it be possible to send such details or provide guidance on where it may be sourced? \r\n\r\nThe fan models are:\r\nCENT 420BL, 380BL, 340BCP, 310BCP\r\nBIF 350/8/39, 300/6/25, 400/6/35, 300/8/30, 315/3/30\r\nBIF+Cowel 650/5/30, 315/4/25\r\nAXIAL 300/6/25, 300/4/25, 300/3/25, 350/8/25, 350/6/35, 250/3/25, 350/4/25, 350/6/30, 315/3/25\r\nHT BIF 630/6/23.5, 630/14/25, 500/7/16.5, 400/4/25, 450/8/25\r\n\r\nAny  assistance is very much appreciated.\r\n\r\nYours faithfully,\r\n\r\nJim Freestone\r\nCEng MCIBSE\r\nMEP Testing & Commissioning Dept. Head\r\nDevelopment of Muscat International Airport\r\nOman Mobile No. +968 99238393\r\nEmail : JimFreestone@becdmia.co.om','2018-07-19 07:08:55','2018-07-19 07:08:55','5014df38-d27f-4ce9-8f1f-27dbb2c749f4'),(16,231,'en','Peter Cheeseman - Thu, 19 Jul 2018 10:50',NULL,'Peter','Cheeseman',NULL,'peter.cheeseman@fercell.com','01622 882927',NULL,NULL,NULL,'Our customer has an old fan that you supplied many years ago. I\'m either after a replacement motor or complete fan. Fan size is 300mm bifurcated for hot air and fume process from a baking oven doing powder coating I have your old spec sheet if this helps. Motor size 0.75kw 2850rpm.\r\nRegards Peter Cheeseman\r\n\r\nFercell Engineering Limited ','2018-07-19 09:50:47','2018-07-19 09:50:47','4c6d36c9-c323-42fa-aa7a-5db8fc530c3e'),(17,232,'en'