ter the below fan for one of our clients to which we are looking for a like for like replacement cost please. \r\n\r\nserial: 23396\r\njob number: 29036\r\nfan type: 400 NTB\r\nDate: 12-03\r\nmotor type: TEFV\r\nmotor kW: 0.25\r\n1PH\r\nFLC: 2.1 amps\r\nmotor RPM: 1440. \r\n\r\nthanks\r\n \r\nJon \r\n ','2018-08-20 08:09:06','2018-08-20 08:09:06','2bd79242-fcc5-43dd-a39e-9638ff2be1a9'),(21,236,'en','Shane Bone - Thu, 23 Aug 2018 16:16',NULL,'Shane','Bone',NULL,'bonsh@sinclair-rush.co.uk','01622620225',NULL,NULL,NULL,'Looking for the following fan or similar, can you help?\r\nExtracting fume (Tetrahydrofuran LRG)\r\nLEV Fan Unit Specification\r\nBackward Curved 600T5 Centrifugal Fan Unit\r\nMotor Direct Driven 5.5Kw 400v 1470 rpm IE2 Foot Mounted\r\nFull Load Current: 10.4 Amps - Start Current: 80 Amps\r\nATEX: Zone 2 \r\nThis fan is provided with a DOL starter for your positioning and fitment\r\nMild Steel Powder Coated RAL5010 Blue\r\nDimensions: 1050mm (H) 977mm (W) 948mm\r\n(Excluding base & pad framework and duct connections)\r\nTotal Weight: 296Kg\r\nFan Performance\r\nThis fume extraction fan with no ductwork attached is designed to offer a maximum\r\npotential airflow of 11000 m-3 hr, including our ductwork scheme layout an is estimated at more\r\nthan 10350 m-3 hr','2018-08-23 15:16:10','2018-08-23 15:16:10','f629a6f6-b2ff-4923-aa9d-5631f294fd61'),(22,237,'en','Shane Bone - Fri, 24 Aug 2018 09:56',NULL,'Shane','Bone',NULL,'bonsh@sinclair-rush.co.uk','01622620225',NULL,NULL,NULL,'Can you source the following motor?\r\nLEV Fan Unit Specification\r\nBackward Curved 600T5 Centrifugal Fan Unit\r\nMotor Direct Driven 5.5Kw 400v 1470 rpm IE2 Foot Mounted\r\nFull Load Current: 10.4 Amps - Start Current: 80 Amps\r\nATEX: Zone \r\nThis fan is provided with a DOL starter for your positioning and fitment\r\nMild Steel Powder Coated RAL5010 Blue\r\nDimensions: 1050mm (H) 977mm (W) 948mm\r\n(Excluding base & pad framework and duct connections)\r\nTotal Weight: 296Kg\r\nFa