017e-4178-8246-356c4a607900'),(26,241,'en','Pat Thornton - Mon, 10 Sep 2018 09:25',NULL,'Pat','Thornton',NULL,'patt@martindesignassociates.com','07584041926',NULL,NULL,NULL,'Morning - My colleague phoned George in sales last week about some fans that were installed at Strensall Barracks, York a few years ago. I\'ve re-visited site and found the following details: Job No 20396, Serial Nos 18244 & 18245. Would it be possible to let me know what the original design volume flow rate and external static pressure these fans were selected to achieve? Appreciate it\'s a big ask!!\r\nMany thanks\r\nPat','2018-09-10 08:25:04','2018-09-10 08:25:04','7fa19f26-9f7c-44a9-9507-17e751fad01b'),(27,242,'en','ANDY THOM - Tue, 11 Sep 2018 10:11',NULL,'ANDY','THOM',NULL,'andrew.thom@rexel.co.uk','01553 760611',NULL,NULL,NULL,'Please can you quote for the following and advise a lead time.  It is for an urgent job.\r\n\r\n0954-2155\r\n\r\nVictoria Fans\r\n\r\nSerial Number 2012-418\r\n\r\nFan Type 250 HTB\r\n\r\nMotor Type TEFV\r\n\r\n230V\r\n\r\nF>L>C> 2.7A0.37kW\r\n\r\n0.37kW\r\n\r\n2645 RPM\r\n\r\nCapacitor for the above is a 14 micro farad.\r\n\r\nThank you.\r\n','2018-09-11 09:11:19','2018-09-11 09:11:19','751ef5ee-f102-4362-b40e-10d6cb50e4d5'),(28,243,'en','Rosemary Clark - Wed, 19 Sep 2018 12:08',NULL,'Rosemary','Clark',NULL,'rosemary.clark@quartzelec.com','01224 593008',NULL,NULL,NULL,'ISO 9001 Certificate &  Employers Liability Insurance & Product/Public Liability Insurance Certificates\r\nGood afternoon\r\nWe are in the process of updating our records for audit purposes and would be grateful if you could forward an up to date copy of the above certificates.\r\n\r\nIf you don’t deal with this matter would you please be good enough to forward to the correct department.\r\n\r\nThank you very much for your help in this matter.\r\n\r\nKind regards\r\n\r\nRosemary            \r\n','2018-09-19 11:08:56','2018-09-19 11:08:56','c3ba9992-4905-4c47-9f63-f3ef4c69fc95'),(29,244,'en','Jason D