f69f-a193-4848-a817-a04c477dcd7a'),(205,424,'en','Rob Clegg - Mon, 30 May 2022 14:18',NULL,'Rob','Clegg',NULL,'Robert.Clegg@nca.nhs.uk','07511 405 909',NULL,NULL,NULL,'Hello,\r\n\r\nI am looking for a bifurcated extract fan for application in an LEV system which will be extracting low levels of formalin from a pathology laboratory.  The laboratory has down draft recirculating cut up benches with carbon activated filters to most of the formalin (formaldehyde + water + methanol in solution).  I have been asked to provide in improved air change rate of extract from the room and as such I would like to install a bifurcated corrosion resistant supplementary extract system for the room.  As such I was looking for an extract fan, with a design duty of 300l/sec (0.3m³/sec or 1,080m³/hr) @ a design pressure of 350pa.\r\n\r\nIt will be installed in line within a ceiling void, and I would like to integrate a inverter for fan speed control for comissioning purposes and I would like to keep the noise as low as practical please as I have no choice over the installation location given it is within the middle floor an existing multistory operational NHS building.\r\n\r\nI have been looking at an Axair S20/160 as I\'ve used them in the past for fume extract mounted hung from the soffit but I would prefer a bifurcated arrangement instead if the option is available if you are able to assist.\r\n\r\nCan you please provide a full datasheet, including the performance curve, drawing (CAD preferable), noise levels (intake, discharge + breakout if possible) and electrical loads and requirements.\r\n\r\nI would appreciate a quotation and if possible include for an inverter which would allow for a remote run signal and the inverter being able to be comissioned to a set inverter speed (Hz) setting for air flow comissioning processes.\r\n\r\nThe works would be undertaken at Salford Royal, so it would be great to have a local supplier for such installations as I cover the 4x hospital sites of th