Duggan - Tue, 07 Oct 2025 07:52',NULL,'Brendan','Duggan',NULL,'brendan.duggan@abbvie.com','0877202047',NULL,NULL,NULL,'Hi We have a long serving victoria fan \r\nJob no: 26176\r\nSerial no 22139\r\nManafacture Date September 2002\r\nI\'m looking for details of the fan andits specifications.','2025-10-07 06:52:10','2025-10-07 06:52:10','910e2fa2-23fb-40b8-88ee-1df81b95e53c'),(376,595,'en','Frances Reid - Wed, 08 Oct 2025 11:11',NULL,'Frances','Reid',NULL,'frances.reid@sulzer.com','07810495499',NULL,NULL,NULL,'Urgent We are trying to track down motor details in respect of what we believe to be a Victoria Fan.  The only information we have is  part number 30-4-30 and or SN S5266.  It is a bit of a longshot but does either of these references mean anything to you. \r\n','2025-10-08 10:11:20','2025-10-08 10:11:20','f9dff79b-1124-4096-8104-25f2280eab62'),(377,596,'en','james  stratton - Mon, 13 Oct 2025 14:18',NULL,'james ','stratton',NULL,'james@morreston.com','07813807651',NULL,NULL,NULL,'good afternoon i have just surveyed a job with one of you bifurcated fans installed. the motor has seized and i am looking for a replacement motor. Please see below description.\r\n\r\nserial number 11623\r\nfan type 600/9/35NIBIF\r\nJOB NO 10329\r\nDATE 29/10/92\r\nMOTOR K.W 1.85 3PH\r\nVOLTAGE 415V/50HZ\r\nMOTOR R.P.M 1440\r\nDATE 29/10/92\r\n\r\nBUSHY FIELDS HOSPITAL ','2025-10-13 13:18:22','2025-10-13 13:18:22','cec47b9c-d110-4627-96af-05a09b6fae47'),(378,597,'en','Steve Basker - Fri, 17 Oct 2025 14:15',NULL,'Steve','Basker',NULL,'steve.basker@awe.co.uk','01189850656',NULL,NULL,NULL,'looking for fan curve as we need to obtain a Volume of 4.57m3/sec from the following fan. \r\n\r\nFan type:   630LCA\r\nFLC   18.9A\r\nJob:  49763\r\nDate   3-25\r\nRPM   2930','2025-10-17 13:15:56','2025-10-17 13:15:56','59c8c90c-2417-4359-8589-91d1756f5c66'),(379,598,'en','NIKKI FISHER - Thu, 13 Nov 2025 10:56',NULL,'NIKKI','FISHER',NULL,'nikkif@motiontek.co.uk','01582598855',NULL,NULL,NULL,'Please can you quote on the below-\r\nEpoxy coated Ally Hubs and PAG blades \r\n\r\n 1 x 394/6/25/3HL/Ally Hub Epoxy coated /PAG Blades/19/A \r\n1 x T2 Shaft 316 Stainless Steel -                           \r\nTo Suit 43406\r\nThanks.\r\n\r\n','2025-11-13 10:56:53','2025-11-13 10:56:53','ff2b27a6-8aef-4fbe-b632-f5397ca091d2'),(380,599,'en','Blair Cowan - Wed, 19 Nov 2025 12:34',NULL,'Blair','Cowan',NULL,'blair@eastaircon.co.uk','07809870908',NULL,NULL,NULL,'Hi, \r\n\r\nIm looking for a cost for a replacement fan. The site is tigerlily in edinburgh. \r\n\r\nFrom the plate on the fan: \r\nfan type: 600 bif\r\nSerial no. 05666\r\nJob no. 31474\r\nmotor type: TEFV\r\nVoltage 415\r\n','2025-11-19 12:34:20','2025-11-19 12:34:20','6110afbc-4fb4-4081-906c-6b8736a6d5b4'),(381,600,'en','Frazer Woodhams - Thu, 20 Nov 2025 11:48',NULL,'Frazer','Woodhams',NULL,'Frazer.Woodhams@red-eng.com','07826021089',NULL,NULL,NULL,'Good Morning - I\'m after a fan selection for some remediation work on an existing commercial building. We need a Bifurcated kitchen extract fan to install into a section of fire rated duct work. The fan it self would need to be 2 hr fire rated. required flowrate 1.5m3/s @ 300Pa static pressure, 3 phase IP55. If you require further details to make a selection please let me know. Many thanks. ','2025-11-20 11:48:08','2025-11-20 11:48:08','ed79e1fb-12c2-4040-8789-e218d716132a'),(382,601,'en','Hudson Rea - Mon, 01 Dec 2025 12:35',NULL,'Hudson','Rea',NULL,'Hudson.Rea@acbnorth.com','07974511714',NULL,NULL,NULL,'The application is for 3 x Electrical Board Cabinets that we want to put a slight positive pressure inside of. Our customer manufactures carbon/graphite powders at 3.5microns and the dust is getting past the cabinet filters and blowing the inverters.\r\nThere are a few other smaller boards in the vicinity they may want to tie this into but we’re just focussing on the 3 main cabinets for now.\r\n\r\nThe electrical cabinets dimensions and volumes are:\r\nL: 2420mm W: 500mm H: 2200mm \r\n1 x Cabinet Overall volume: 2.64m3 \r\n3 x Volume = 7.92/m3\r\nI’d imagine around 10 air changes an hour would suffice, with some leakage taken into consideration (5%) we’d be looking for a fan flow rate of around 80-100m3/hour. This hasn\'t taken into consideration pipe duct flow rate calculations but overall pipework system would be <30m I believe.\r\n\r\nDo you have any fans + ancillary equipment that may fit this kind of application with appropriate dust filtration to ≥3.5microns? There is also an option to place the fan outside the building and duct in to negate the atex issue from the powder.\r\n\r\nAppreciate any assistance you can offer with this.\r\n\r\nKind regards,\r\nHudson Rea','2025-12-01 12:35:38','2025-12-01 12:35:38','970ff474-0f88-4c78-ac7b-02e323bd056a'),(383,602,'en','Michael  Maguire - Tue, 09 Dec 2025 14:00',NULL,'Michael ','Maguire',NULL,'Michael.Maguire@Diageo.com','00353863593973',NULL,NULL,NULL,'Afternoon I work for Diageo in Dublin Ireland . We have one of your extractor fans on are roof and it is currently out of action  it looks like we need a new impellor do you have agents  in Ireland who I could contact  or I would be happy to deal directly with yourselves . If someone could contact me ASAP it would be great as its an extractor for the kitchen and I am under a good bit of pressure  to get this sorted . ','2025-12-09 14:00:03','2025-12-09 14:00:03','5aec3af3-3a8c-4583-a2ba-f2f2c9f94dfb'),(384,603,'en','Priyanka B - Sat, 27 Dec 2025 09:52',NULL,'Priyanka','B',NULL,'priyanka@marcelpiping.com','+919082907329',NULL,NULL,NULL,'Marcel Piping Projects Supply Pvt Ltd has been a committed partner in the industry since 2007, dedicated to satisfying the diverse needs of our customers. As a leading manufacturer of pipe fittings and flanges adhering to national and international standards, we have established expertise in this domain.\r\n \r\nWe offer a wide range of products, including:\r\n \r\nMaterials:\r\n•         Stainless Steel\r\n•         Duplex/Super Duplex Steel\r\n•         Alloy Steel\r\n•         Carbon Steel\r\n•         Inconel\r\n•         Other Ferrous & Non-Ferrous Metals\r\nFlanges:\r\n•         Ratings & Schedules: CLASS 150#, 300#, 400#, 600#, 900#, 1500#, 2500#\r\n•         Weld Neck Flange: ½\" to 56\"\r\n•         Slip On Flange: ½\" to 56\"\r\n•         Socket Weld Flange: ½\" to 2\"\r\n•         Lap Joint Flange: ½\" to 24\"\r\n•         Blind Flange: ½\" to 56\"\r\nSMLS Fittings (Seamless):\r\n•         Elbow 45 °& 90° : ½\" to 24\" SCH (10-160)\r\n•         Equal/Unequal Tee: ½\" to 24\" SCH (10-160)\r\n•         Concentric Reducers: ½\" to 24\" SCH (10-160)\r\n•         Eccentric Reducers: ½\" to 24\" SCH (10-160)\r\n•         Caps: ½\" to 24\" SCH (10-160)\r\n•         Stub Ends: ½\" to 24\" SCH (10-160)\r\n•         Special Bends (Long Radius): R=3D, 5D, 6D, 10D, ½\" to 24\" SCH (10-160)\r\n•         Equal/Unequal Split Tee: ½\" to 24\" SCH (10-160)\r\n \r\nWe look forward to the opportunity to serve your needs and build a long-lasting business relationship. Please feel free to reach out for any inquiries or further information.','2025-12-27 09:52:37','2025-12-27 09:52:37','b805c642-58f2-41c8-9e3b-2d947a3dc26f');
