sectetur adipiscing elit. Nullam at lectus ipsum. Nam vehicula felis a mi commodo, id lacinia nisi ultricies. Nunc ut libero sit amet diam scelerisque gravida.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\\r\\n  <\\/p>\"}},\"63\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}},\"64\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Example of Coding\",\"fd_st_text\":\"<p>A typical example of coding is 630\\/9\\/35 indicating :\\r\\n  <\\/p>\\r\\n<ul><li>630 diameter in mm<\\/li><li>9 number of blades<\\/li><li>35 blade angle in degrees<\\/li><\\/ul>\"}},\"65\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.&nbsp; Finishes: External Terminal Box.<\\/p>\"}},\"66\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li>Standard Fans: Galvanised<\\/li><li>Optional Finishes: Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"59\"],\"7\":\"All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings\"}}','2017-03-23 15:51:14','2017-03-23 15:51:14','2f05cbd4-bd4f-4d11-b50a-b2a19aa06113'),(93,19,3,1,'en',6,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Bifurcated Fans\",\"slug\":\"bifurcated-fans\",\"postDate\":1488211620,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":\"<p>Aliquam a tortor et nibh interdum egestas. Proin orci erat, mattis a tincidunt nec, efficitur id neque. Suspendisse scelerisque semper vestibulum.<\\/p>\",\"4\":{\"new1\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Uses\",\"fd_st_text\":\"<p>For exhausting hot gasses, paint fumes (excluding, cellulose), steam, smoke and dust laden air, available in diameters 250-1250mm.<\\/p>\"}},\"new2\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fan Type NT\",\"fd_st_text\":\"<p>Normal Temperature \\u2013 upto 80\\u00b0C (176\\u00b0F).&nbsp;&nbsp; Constructed in mild steel with a polypropylene impeller and Class F insulation motor.&nbsp;&nbsp; Special corrosion- resistant finishes available. &nbsp;Standard finish - Galvanised.<\\/p>\"}},\"new3\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fan Type HT\",\"fd_st_text\":\"<p>High Temperature&nbsp; - upto 200\\u00b0C (392\\u00b0F).&nbsp; Constructed in mild steel with an aluminium impeller and Class F insulation motor.&nbsp; Special corrosion- resistant finishes available. Standard finish&nbsp; - galvanised.<\\/p>\"}},\"new4\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>Standard three or single phase motors can be fitted along with ATEX ZONE 1 or 2 and company specification units when required.<\\/p>\"}},\"new5\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Plastic Fans\",\"fd_st_text\":\"<p>This range of fans can also be constructed from rigid PVC sheet reinforced with fibreglass and suitable for a wide fans of uses in the chemical industry and in the extraction of acid fumes from industrial processes.&nbsp; Dimensions and performance data as for normal Bifurcated fans.\\r\\n  <\\/p>\\r\\n<p>For exhausting hot gasses, chemical vapours, steam and moisture laden air, available in diameters 250-1000mm.&nbsp; Max temp 60\\u00b0C<\\/p>\"}},\"new6\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Stainless Steel Fan Type 304\",\"fd_st_text\":\"<p>Ideal for use in the catering industry for air temperature upto 80\\u00b0C (176\\u00b0F).&nbsp; For exhausting warm air and steam.&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class \\u2018F\\u2019 standard motor with a stainless steel extended shaft.<\\/p>\"}},\"new7\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Stainless Steel Fan Type 316\",\"fd_st_text\":\"<p>Uses mainly in the chemical and allied trades.&nbsp; Suitable for most acid vapours upto 80\\u00b0C (176\\u00b0F).&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class F standard motor with a stainless steel extended shaft.<\\/p>\"}},\"new8\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<ul><li>Mounting feet<\\/li><li>flexible connections<\\/li><li>AV Mountings<\\/li><li>Mating Flanges<\\/li><li>Inlet Cones<\\/li><li>Guards<\\/li><li>Back-draught shutters<\\/li><li>Special Paint finishes<\\/li><\\/ul>\"}},\"new9\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li><strong>Standard Fans:<\\/strong> Galvanised<\\/li><li><strong>Optional Finishes:<\\/strong> Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"60\"],\"7\":\"For the foodstuffs and chemical industries these fans can be constructed from stainless steel of aluminium at competitive cost.\"}}','2017-03-23 16:22:43','2017-03-23 16:22:43','cd1aae24-2a1c-425d-a4df-bed58d56dcb2'),(94,20,3,1,'en',6,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":\"<p>Praesent non elit nec sem interdum suscipit quis imperdiet felis. Praesent nulla ligula, consectetur sit amet tortor commodo, tristique viverra ex. Pellentesque laoreet erat sit amet sagittis tempor.<\\/p>\",\"4\":{\"new1\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/ol>\\r\\n\"}},\"new2\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p><ul><li><b>PADDLE BLADE FANS:&nbsp;<\\/b>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018build up\\u2019 of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.&nbsp; Normally in the region of 7-20 mtrs\\/sec.<\\/li><li><b>MULTIVANE OR FORWARD CURVED FANS:&nbsp;<\\/b>Used for general ventilation purposes \\u2013 not good for dust etc.&nbsp; Limited pressure characteristics.&nbsp; Normal discharge velocities 5-13 mts\\/sec<\\/li><li><b>BACKWARD CURVED OR BACKWARD SLOPING FANS:&nbsp;<\\/b>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal velocities 9-16 mts\\/sec<\\/li><li><b>AEROFOIL FANS:&nbsp;<\\/b>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.&nbsp; Recommend for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 7-15 mts\\/sec.<\\/li><li><b>HIGH PRESSURE BLOWERS:&nbsp;<\\/b>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc&nbsp; Normal discharge velocities 15-30 mts\\/sec.<\\/li><\\/ul>\\r\\n<p><span><\\/span><\\/p>\"}}},\"25\":[\"59\"],\"7\":\"Since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved.  Any reduction in the requirements could easily overload the motor.\"}}','2017-03-23 16:28:11','2017-03-23 16:28:11','ac0444d7-8343-4807-91e2-f942497c8aa1'),(95,22,3,1,'en',3,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Conical Bifurcated\",\"slug\":\"conical-bifurcated-fans\",\"postDate\":1488211740,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"19\",\"fields\":{\"10\":[\"4\",\"5\",\"6\"],\"13\":\"\",\"21\":\"\",\"18\":\"\",\"19\":\"\",\"12\":\"\",\"11\":\"\",\"16\":\"\"}}','2017-03-23 16:41:02','2017-03-23 16:41:02','350acbd5-ed87-4be1-9872-5617167fef9d'),(96,23,3,1,'en',5,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Cylindrical Bifurcated\",\"slug\":\"cylindrical-bifurcated-fans\",\"postDate\":1488211740,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"19\",\"fields\":{\"10\":[\"4\",\"5\",\"6\"],\"13\":\"\",\"21\":\"\",\"18\":[\"53\"],\"19\":\"\",\"12\":\"\",\"11\":\"<p>Curabitur magna sapien, consectetur eget nulla tincidunt, euismod ultrices mi. Praesent id venenatis felis, at accumsan elit. Vivamus bibendum ullamcorper arcu ut efficitur.<\\/p>\",\"16\":\"\"}}','2017-03-23 16:41:47','2017-03-23 16:41:47','f4f68624-d3f0-45dd-a37e-5fd5aa8ee881'),(97,18,3,1,'en',21,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Plate Mounted Axial\",\"slug\":\"plate-mounted-axial-flow-fan\",\"postDate\":1488211380,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"17\",\"fields\":{\"34\":[\"4\",\"6\"],\"13\":{\"45\":{\"type\":\"2\",\"fields\":{\"fd_st_component_name\":\"Mounting Plate\",\"fd_st_componentText\":\"Fabricated in Steel and finished in Epoxy resin. 304 or 316 Stainless Steel available if required.\\u200b\"}},\"46\":{\"type\":\"2\",\"fields\":{\"fd_st_component_name\":\"Impellers\",\"fd_st_componentText\":\"Aluminium Hub with polypropylene blades. Anti-Static or Aluminium blades available if required\"}},\"47\":{\"type\":\"2\",\"fields\":{\"fd_st_component_name\":\"Motors\",\"fd_st_componentText\":\"Single or 3 phase Class F IP55 as standard with 2 speed, Zone 1 or Zone 2 as optional extras\"}}},\"21\":{\"49\":{\"type\":\"4\",\"fields\":{\"dataTable\":\"{\\\"columns\\\":{\\\"col0\\\":{\\\"heading\\\":\\\"Fan Size\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col1\\\":{\\\"heading\\\":\\\"Frame\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col2\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col3\\\":{\\\"heading\\\":\\\"B\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col4\\\":{\\\"heading\\\":\\\"C\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col5\\\":{\\\"heading\\\":\\\"D\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col6\\\":{\\\"heading\\\":\\\"E\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"}},\\\"rows\\\":{\\\"row0\\\":{\\\"col0\\\":\\\"250\\\",\\\"col1\\\":\\\"71\\\",\\\"col2\\\":\\\"370\\\",\\\"col3\\\":\\\"370\\\",\\\"col4\\\":\\\"330\\\",\\\"col5\\\":\\\"25\\\",\\\"col6\\\":\\\"10\\\"},\\\"row1\\\":{\\\"col0\\\":\\\"300\\\",\\\"col1\\\":\\\"71\\\",\\\"col2\\\":\\\"420\\\",\\\"col3\\\":\\\"420\\\",\\\"col4\\\":\\\"330\\\",\\\"col5\\\":\\\"25\\\",\\\"col6\\\":\\\"10\\\"},\\\"row2\\\":{\\\"col0\\\":\\\"315\\\",\\\"col1\\\":\\\"71\\\",\\\"col2\\\":\\\"435\\\",\\