4 11:50:58','8ddaabe6-fbbd-4b1a-b28d-2e4fc29e91c4'),(108,30,3,1,'en',4,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"High Pressure Centrifugal Blowers\",\"slug\":\"high-pressure-blowers\",\"postDate\":1488212220,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"20\",\"fields\":{\"34\":\"\",\"13\":\"\",\"21\":\"\",\"18\":[\"53\"],\"19\":\"\",\"12\":\"\",\"11\":\"<p>High Pressure Centrifugal Blowers..Fusce volutpat odio vel purus tincidunt semper. Aliquam at maximus mi. Integer congue dapibus congue. Etiam tempus est sit amet erat maximus, vel ultricies tortor vestibulum.&nbsp;&nbsp;<\\/p>\",\"16\":\"\"}}','2017-03-24 11:52:18','2017-03-24 11:52:18','8920101a-38cb-4cc2-aa76-e60267f148ad'),(109,32,3,1,'en',3,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Paddle Bladed Centrifugal Fans\",\"slug\":\"paddle-bladed\",\"postDate\":1488212280,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"20\",\"fields\":{\"34\":\"\",\"13\":\"\",\"21\":\"\",\"18\":[\"54\"],\"19\":\"\",\"12\":\"\",\"11\":\"<p>Paddle&nbsp;Nullam mattis magna quis metus semper viverra non at eros. Vestibulum rhoncus pharetra nibh, at scelerisque turpis elementum quis. Curabitur elit dolor, fringilla quis lacus ac, efficitur lobortis enim.<\\/p>\",\"16\":\"\"}}','2017-03-24 11:52:44','2017-03-24 11:52:44','c01a739a-28d3-4b5e-bf4e-a8140bcd088b'),(110,33,3,1,'en',3,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Forward Curved Centrifugal Fans\",\"slug\":\"forward-curved\",\"postDate\":1488212280,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"20\",\"fields\":{\"34\":\"\",\"13\":\"\",\"21\":\"\",\"18\":[\"53\"],\"19\":\"\",\"12\":\"\",\"11\":\"<p>Forward&nbsp;Pellentesque tincidunt lacinia semper. Sed lacinia eget est non commodo. Aliquam leo dolor, molestie ac ex at, ultricies consectetur neque. Fusce eget dignissim eros, id mollis est. Aenean at vehicula ante, eu imperdiet lorem.<\\/p>\",\"16\":\"\"}}','2017-03-24 11:53:11','2017-03-24 11:53:11','97ed2ae9-64f1-4ccc-8628-7b0fbc824cf8'),(112,21,3,1,'en',5,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Flameproof Fans EXD Zone 1 & 2\",\"slug\":\"flameproof-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":\"<p>Morbi quis pulvinar nisi. Proin et magna enim. Donec quis mi vitae diam fringilla placerat et hendrerit massa. Vestibulum sit amet urna posuere diam lacinia egestas.<\\/p>\",\"4\":\"\",\"25\":[\"60\"],\"7\":\"\"}}','2017-03-27 13:18:34','2017-03-27 13:18:34','78ac0f51-d56a-4cba-a87e-42bc6069d347'),(113,20,3,1,'en',7,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":\"<p>Praesent non elit nec sem interdum suscipit quis imperdiet felis. Praesent nulla ligula, consectetur sit amet tortor commodo, tristique viverra ex. Pellentesque laoreet erat sit amet sagittis tempor.<\\/p>\",\"4\":{\"76\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><li><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/li><\\/ol>\"}},\"77\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p>\"}},\"new1\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Paddle Blade Fans\",\"fd_st_text\":\"<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018build up\\u2019 of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.&nbsp; Normally in the region of 7-20 mtrs\\/sec.<\\/p>\"}},\"new2\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Multivane or Forward Curved Fans\",\"fd_st_text\":\"<p>Used for general ventilation purposes \\u2013 not good for dust etc.&nbsp; Limited pressure characteristics.&nbsp; Normal discharge velocities 5-13 mts\\/sec<\\/p>\"}},\"new3\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Backward Curved or Backward Sloping Fans\",\"fd_st_text\":\"<p>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal velocities 9-16 mts\\/sec<\\/p>\"}},\"new4\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Aerofoil Fans\",\"fd_st_text\":\"<p>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.&nbsp; Recommend for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 7-15 mts\\/sec.<\\/p>\"}},\"new5\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"High Pressure Blowers\",\"fd_st_text\":\"<p>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc&nbsp; Normal discharge velocities 15-30 mts\\/sec.<\\/p>\"}}},\"25\":[\"59\"],\"7\":\"Since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved.  Any reduction in the requirements could easily overload the motor.\"}}','2017-03-27 14:32:13','2017-03-27 14:32:13','53810db2-aaf8-4ffd-8c44-3656babdac53'),(114,17,3,1,'en',11,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial Flow Fans\",\"slug\":\"axial-flow-fans\",\"postDate\":1488211320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>An&nbsp;<b>axial fan<\\/b>&nbsp;is a type of a compressor that increases the pressure of the air flowing through it. The blades of the&nbsp;<b>axial flow fan<\\/b>&nbsp;forces air to move parallel to the shaft about which the blades rotate. In other words, the&nbsp;<b>flow<\\/b>&nbsp;is axially in and axially out, linearly, hence their name.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\\r\\n  <\\/p>\"}},\"63\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}},\"64\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Example of Coding\",\"fd_st_text\":\"<p>A typical example of coding is 630\\/9\\/35 indicating :\\r\\n  <\\/p>\\r\\n<ul><li>630 diameter in mm<\\/li><li>9 number of blades<\\/li><li>35 blade angle in degrees<\\/li><\\/ul>\"}},\"65\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.&nbsp; Finishes: External Terminal Box.<\\/p>\"}},\"66\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li>Standard Fans: Galvanised<\\/li><li>Optional Finishes: Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"59\"],\"7\":\"All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings\"}}','2017-07-24 15:46:45','2017-07-24 15:46:45','ddfd46e9-7808-40d5-84aa-8fcccca2e04a'),(115,17,3,1,'en',12,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial Flow Fans\",\"slug\":\"axial-flow-fans\",\"postDate\":1488211320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Our Axial Fans can be supplied as both cased and plate mounted versions. These fans are suitable for most applications including general ventilation for large, medium and small industrial spaces. &nbsp;The size of space and purpose will determine which variant and size of fan is most appropriate to your specific requirement. &nbsp;Our experts are on hand to assist you with choosing the correct fan.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\\r\\n  <\\/p>\"}},\"63\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}},\"64\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Example of Coding\",\"fd_st_text\":\"<p>A typical example of coding is 630\\/9\\/35 indicating :\\r\\n  <\\/p>\\r\\n<ul><li>630 diameter in mm<\\/li><li>9 number of blades<\\/li><li>35 blade angle in degrees<\\/li><\\/ul>\"}},\"65\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.&nbsp; Finishes: External Terminal Box.<\\/p>\"}},\"66\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li>Standard Fans: Galvanised<\\/li><li>Optional Finishes: Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"59\"],\"7\":\"All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings\"}}','2017-07-24 16:29:19','2017-07-24 16:29:19','1f0d7cfa-f109-4015-8f33-44dcf3a95c28'),(116,108,3,1,'en',1,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial & Bifurcated Ancillaries\",\"slug\":\"axial-bifurcated-ancillaries\",\"postDate\":1500974583,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>The following ancillaries can be provided as optional extras for Axial and Bifurcated Fans<\\/p>\",\"4\":{\"new1\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"\",\"fd_st_text\":\"\"}}},\"25\":\"\",\"7\":\"\"}}','2017-07-25 09:23:03','2017-07-25 09:23:03','a7a662d4-2de2-4151-b98b-6677bcfa66c4'),(117,110,3,1,'en',1,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Mounting Feet\",\"slug\":\"mounting-feet\",\"postDate\":1500974629,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"34\":\"