es.&nbsp; Suitable for most acid vapours upto 80\\u00b0C (176\\u00b0F).&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class F standard motor with a stainless steel extended shaft.<\\/p>\"}},\"74\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<ul><li>Mounting feet<\\/li><li>flexible connections<\\/li><li>AV Mountings<\\/li><li>Mating Flanges<\\/li><li>Inlet Cones<\\/li><li>Guards<\\/li><li>Back-draught shutters<\\/li><li>Special Paint finishes<\\/li><\\/ul>\"}},\"75\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li><strong>Standard Fans:<\\/strong> Galvanised<\\/li><li><strong>Optional Finishes:<\\/strong> Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"60\"],\"7\":\"For the foodstuffs and chemical industries these fans can be constructed from stainless steel of aluminium at competitive cost.\"}}','2017-07-25 09:40:54','2017-07-25 09:40:54','38d22ffb-ee36-4e03-b0e7-d553f2147c06'),(129,28,3,1,'en',4,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Man Cooler Axial\",\"slug\":\"man-cooler-axial-flow-fans\",\"postDate\":1488211800,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"17\",\"fields\":{\"34\":\"\",\"13\":\"\",\"21\":\"\",\"18\":[\"54\"],\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"12\":\"\",\"11\":\"<p>As an alternative to fixed installations, this flexible range is ideal in the ventilation of factories or confined spaces such as ships\' holds. &nbsp;Man Cooler Fans are also useful for cooling bricks and drying grain. &nbsp;These fans can be aimed at distinct locations by fitting a flexible or canvas hose.<\\/p>\",\"16\":\"\"}}','2017-07-25 09:43:36','2017-07-25 09:43:36','b13e4857-1e4d-4f49-a90e-3eb88750e260'),(130,28,3,1,'en',5,'','{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Man Cooler Axial\",\"slug\":\"man-cooler-axial-flow-fans\",\"postDate\":1488211800,\"expiryDate\":null,\"enabled\"