\\":\\\"112\\\",\\\"col2\\\":\\\"1000\\\",\\\"col3\\\":\\\"1000\\\",\\\"col4\\\":\\\"460\\\",\\\"col5\\\":\\\"40\\\",\\\"col6\\\":\\\"12\\\"},\\\"row4\\\":{\\\"col0\\\":\\\"900\\\",\\\"col1\\\":\\\"100\\\",\\\"col2\\\":\\\"1100\\\",\\\"col3\\\":\\\"1100\\\",\\\"col4\\\":\\\"460\\\",\\\"col5\\\":\\\"50\\\",\\\"col6\\\":\\\"14\\\"},\\\"row5\\\":{\\\"col0\\\":\\\"900\\\",\\\"col1\\\":\\\"112\\\",\\\"col2\\\":\\\"1100\\\",\\\"col3\\\":\\\"1100\\\",\\\"col4\\\":\\\"465\\\",\\\"col5\\\":\\\"50\\\",\\\"col6\\\":\\\"14\\\"},\\\"row6\\\":{\\\"col0\\\":\\\"900\\\",\\\"col1\\\":\\\"132\\\",\\\"col2\\\":\\\"1100\\\",\\\"col3\\\":\\\"1100\\\",\\\"col4\\\":\\\"540\\\",\\\"col5\\\":\\\"50\\\",\\\"col6\\\":\\\"14\\\"},\\\"row7\\\":{\\\"col0\\\":\\\"1000\\\",\\\"col1\\\":\\\"100\\\",\\\"col2\\\":\\\"1250\\\",\\\"col3\\\":\\\"1250\\\",\\\"col4\\\":\\\"460\\\",\\\"col5\\\":\\\"50\\\",\\\"col6\\\":\\\"14\\\"},\\\"row8\\\":{\\\"col0\\\":\\\"1000\\\",\\\"col1\\\":\\\"112\\\",\\\"col2\\\":\\\"1250\\\",\\\"col3\\\":\\\"1250\\\",\\\"col4\\\":\\\"460\\\",\\\"col5\\\":\\\"50\\\",\\\"col6\\\":\\\"14\\\"},\\\"row9\\\":{\\\"col0\\\":\\\"1000\\\",\\\"col1\\\":\\\"132\\\",\\\"col2\\\":\\\"1250\\\",\\\"col3\\\":\\\"1250\\\",\\\"col4\\\":\\\"465\\\",\\\"col5\\\":\\\"50\\\",\\\"col6\\\":\\\"14\\\"}}}\",\"columns\":{\"col0\":{\"heading\":\"Fan Size\",\"width\":\"\",\"align\":\"left\"},\"col1\":{\"heading\":\"Frame\",\"width\":\"\",\"align\":\"left\"},\"col2\":{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},\"col3\":{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},\"col4\":{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},\"col5\":{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},\"col6\":{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"}},\"rows\":{\"row0\":{\"col0\":\"710\",\"col1\":\"100\",\"col2\":\"900\",\"col3\":\"900\",\"col4\":\"445\",\"col5\":\"40\",\"col6\":\"12\"},\"row1\":{\"col0\":\"800\",\"col1\":\"90\",\"col2\":\"1000\",\"col3\":\"1000\",\"col4\":\"415\",\"col5\":\"40\",\"col6\":\"12\"},\"row2\":{\"col0\":\"800\",\"col1\":\"100\",\"col2\":\"1000\",\"col3\":\"1000\",\"col4\":\"460\",\"col5\":\"40\",\"col6\":\"12\"},\"row3\":{\"col0\":\"800\",\"col1\":\"112\",\"col2\":\"1000\",\"col3\":\"1000\",\"col4\":\"460\",\"col5\":\"40\",\"col6\":\"12\"},\"row4\":{\"col0\":\"900\",\"col1\":\"100\",\"col2\":\"1100\",\"col3\":\"1100\",\"col4\":\"460\",\"col5\":\"50\",\"col6\":\"14\"},\"row5\":{\"col0\":\"900\",\"col1\":\"112\",\"col2\":\"1100\",\"col3\":\"1100\",\"col4\":\"465\",\"col5\":\"50\",\"col6\":\"14\"},\"row6\":{\"col0\":\"900\",\"col1\":\"132\",\"col2\":\"1100\",\"col3\":\"1100\",\"col4\":\"540\",\"col5\":\"50\",\"col6\":\"14\"},\"row7\":{\"col0\":\"1000\",\"col1\":\"100\",\"col2\":\"1250\",\"col3\":\"1250\",\"col4\":\"460\",\"col5\":\"50\",\"col6\":\"14\"},\"row8\":{\"col0\":\"1000\",\"col1\":\"112\",\"col2\":\"1250\",\"col3\":\"1250\",\"col4\":\"460\",\"col5\":\"50\",\"col6\":\"14\"},\"row9\":{\"col0\":\"1000\",\"col1\":\"132\",\"col2\":\"1250\",\"col3\":\"1250\",\"col4\":\"465\",\"col5\":\"50\",\"col6\":\"14\"}}}}},\"18\":[\"53\"],\"19\":[\"55\",\"56\"],\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"12\":\"Wall or roof mounting where ducting is not required.\",\"11\":\"<p>Plate Mounted Axial fans are designed for Clean Air Supply and extraction of poor quality air.&nbsp; &nbsp;By adding a vertical jet or low profile cowl, these fans serve as effective roof extract units.<\\/p>\",\"16\":{\"48\":{\"type\":\"3\",\"fields\":{\"fd_st_noteText\":\"1. This type of fan can be fitted beneath in LOW PROFILE or VERTICAL JET ROOF COWL as supplied by Victoria Fans.\\r\\n2. The fans may only be operated when installed as intended and when safety is ensured.\"}}}}}','2017-10-03 08:43:53','2017-10-03 08:43:53','2d48c6d7-5f49-4e0a-a1ef-5096d01cde97'),(181,21,3,1,'en',7,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Flameproof Fans for hazardous areas, zones 1 & 2\",\"slug\":\"flameproof-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Morbi quis pulvinar nisi. Proin et magna enim. Donec quis mi vitae diam fringilla placerat et hendrerit massa. Vestibulum sit amet urna posuere diam lacinia egestas.<\\/p>\",\"4\":\"\",\"25\":[\"60\"],\"7\":\"\"}}','2017-10-03 08:51:33','2017-10-03 08:51:33','aa62fad3-78b7-43c8-951a-b901f2a67a69'),(182,17,3,1,'en',13,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial Flow Fans\",\"slug\":\"axial-flow-fans\",\"postDate\":1488211320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Our Axial Fans can be supplied as both cased and plate mounted versions. These fans are suitable for most applications including general ventilation for large, medium and small industrial spaces. &nbsp;The size of space and purpose will determine which variant and size of fan is most appropriate to your specific requirement. &nbsp;Our experts are on hand to assist you with choosing the correct fan.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\\r\\n  <\\/p>\"}},\"63\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}},\"64\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Example of Coding\",\"fd_st_text\":\"<p>A typical example of coding is 630\\/9\\/35 indicating :\\r\\n  <\\/p>\\r\\n<ul><li>630 diameter in mm<\\/li><li>9 number of blades<\\/li><li>35 blade angle in degrees<\\/li><\\/ul>\"}},\"65\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.&nbsp; Finishes: External Terminal Box.<\\/p>\"}},\"66\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li>Standard Fans: Galvanised<\\/li><li>Optional Finishes: Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"147\"],\"7\":\"All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings\"}}','2017-11-23 17:32:17','2017-11-23 17:32:17','8c0d344e-7038-45a0-9cf1-da24ae767b64'),(183,19,3,1,'en',10,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Bifurcated Fans\",\"slug\":\"bifurcated-fans\",\"postDate\":1488211620,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Bifurcated fans are used to exhaust a wide variety of hot gases, paint fumes, smoke, steam and dust in suspension.<\\/p>\",\"4\":{\"67\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Uses\",\"fd_st_text\":\"<p>For exhausting hot gasses, paint fumes (excluding, cellulose), steam, smoke and dust laden air, available in diameters 250-1250mm.<\\/p>\"}},\"68\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fan Type NT\",\"fd_st_text\":\"<p>Normal Temperature \\u2013 upto 80\\u00b0C (176\\u00b0F).&nbsp;&nbsp; Constructed in mild steel with a polypropylene impeller and Class F insulation motor.&nbsp;&nbsp; Special corrosion- resistant finishes available. Standard finish - Galvanised.<\\/p>\"}},\"69\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fan Type HT\",\"fd_st_text\":\"<p>High Temperature&nbsp; - upto 200\\u00b0C (392\\u00b0F).&nbsp; Constructed in mild steel with an aluminium impeller and Class F insulation motor.&nbsp; Special corrosion- resistant finishes available. Standard finish&nbsp; - galvanised.<\\/p>\"}},\"70\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>Standard three or single phase motors can be fitted along with ATEX ZONE 1 or 2 and company specification units when required.<\\/p>\"}},\"71\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Plastic Fans\",\"fd_st_text\":\"<p>This range of fans can also be constructed from rigid PVC sheet reinforced with fibreglass and suitable for a wide fans of uses in the chemical industry and in the extraction of acid fumes from industrial processes.&nbsp; Dimensions and performance data as for normal Bifurcated fans.\\r\\n  <\\/p>\\r\\n<p>For exhausting hot gasses, chemical vapours, steam and moisture laden air, available in diameters 250-1000mm.&nbsp; Max temp 60\\u00b0C<\\/p>\"}},\"72\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Stainless Steel Fan Type 304\",\"fd_st_text\":\"<p>Ideal for use in the catering industry for air temperature upto 80\\u00b0C (176\\u00b0F).&nbsp; For exhausting warm air and steam.&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class \\u2018F\\u2019 standard motor with a stainless steel extended shaft.<\\/p>\"}},\"73\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Stainless Steel Fan Type 316\",\"fd_st_text\":\"<p>Uses mainly in the chemical and allied trades.&nbsp; Suitable for most acid vapours upto 80\\u00b0C (176\\u00b0F).&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class F standard motor with a stainless steel extended shaft.<\\/p>\"}},\"74\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<ul><li>Mounting feet<\\/li><li>flexible connections<\\/li><li>AV Mountings<\\/li><li>Mating Flanges<\\/li><li>Inlet Cones<\\/li><li>Guards<\\/li><li>Back-draught shutters<\\/li><li>Special Paint finishes<\\/li><\\/ul>\"}},\"75\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li><strong>Standard Fans:<\\/strong> Galvanised<\\/li><li><strong>Optional Finishes:<\\/strong> Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"148\"],\"7\":\"For the foodstuffs and chemical industries these fans can be constructed from stainless steel of aluminium at competitive cost.\"}}','2017-11-23 17:32:31','2017-11-23 17:32:31','ef3c47e9-d46e-4d85-8e41-68236d3a166a'),(184,20,3,1,'en',8,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Praesent non elit nec sem interdum suscipit quis imperdiet felis. Praesent nulla ligula, consectetur sit amet tortor commodo, tristique viverra ex. Pellentesque laoreet erat sit amet sagittis tempor.<\\/p>\",\"4\":{\"76\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><li><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/li><\\/ol>\"}},\"77\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p>\"}},\"88\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Paddle Blade Fans\",\"fd_st_text\":\"<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018build up\\u2019 of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.&nbsp; Normally in the region of 7-20 mtrs\\/sec.<\\/p>\"}},\"89\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Multivane or Forward Curved Fans\",\"fd_st_text\":\"<p>Used for general ventilation purposes \\u2013 not good for dust etc.&nbsp; Limited pressure characteristics.&nbsp; Normal discharge velocities 5-13 mts\\/sec<\\/p>\"}},\"90\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Backward Curved or Backward Sloping Fans\",\"fd_st_text\":\"<p>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal velocities 9-16 mts\\/sec<\\/p>\"}},\"91\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Aerofoil Fans\",\"fd_st_text\":\"<p>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.&nbsp; Recommend for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 7-15 mts\\/sec.<\\/p>\"}},\"92\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"High Pressure Blowers\",\"fd_st_text\":\"<p>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc&nbsp; Normal discharge velocities 15-30 mts\\/sec.<\\/p>\"}}},\"25\":[\"149\"],\"7\":\"Since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved.  Any reduction in the requirements could easily overload the motor.\"}}','2017-11-23 17:32:45','2017-11-23 17:32:45','bbdede84-66f4-41b4-8c05-2e6e3a2be02b'),(185,20,3,1,'en',9,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Praesent non elit nec sem interdum suscipit quis imperdiet felis. Praesent nulla ligula, consectetur sit amet tortor commodo, tristique viverra ex. Pellentesque laoreet erat sit amet sagittis tempor.<\\/p>\",\"4\":{\"76\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><li><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/li><\\/ol>\"}},\"77\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p>\"}},\"88\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Paddle Blade Fans\",\"fd_st_text\":\"<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018bu