349\",\"col16\":\"413\",\"col17\":\"8\",\"col18\":\"10\",\"col19\":\"384\",\"col20\":\"2\",\"col21\":\"117\",\"col22\":\"2\",\"col23\":\"111\",\"col24\":\"19\",\"col25\":\"19\"}}}}},\"18\":\"\",\"19\":[\"178\",\"179\"],\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"12\":\"\",\"11\":\"<p>Non-overloading power characteristics suitable for very light dust applications (e.g. clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 16 - 30 mts\\/sec.<\\/p>\",\"16\":\"\"}}','2018-06-20 09:48:55','2018-06-20 09:48:55','9da9cf01-0af5-4a7e-8301-16721448aa86'),(277,20,3,1,'en',15,'','{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"57\":{\"202\":{\"type\":\"6\",\"fields\":{\"specialTitle\":\"Right Hand Fans\",\"supportImages\":[\"196\",\"200\",\"201\",\"198\",\"197\",\"199\"],\"specialNote\":\"\"}},\"203\":{\"type\":\"6\",\"fields\":{\"specialTitle\":\"Left Hand Fans\",\"supportImages\":[\"190\",\"194\",\"195\",\"192\",\"191\",\"193\"],\"specialNote\":\"\"}}},\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics.<\\/p>\",\"4\":{\"76\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><li><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/li><\\/ol>\"}},\"77\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p>\"}},\"88\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Paddle Blade Fans\",\"fd_st_text\":\"<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018build up\\u2019 of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.&nbsp; Normally in the region of 7-20 mtrs\\/sec.<\\/p>\"}},\"89\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Multivane or Forward Curved Fans\",\"fd_st_text\":\"<p>Used for general ventilation purposes \\u2013 not good for dust etc.&nbsp; Limited pressure characteristics.&nbsp; Normal discharge velocities 5-13 mts\\/sec<\\/p>\"}},\"90\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Backward Curved or Backward Sloping Fans\",\"fd_st_text\":\"<p>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal velocities 9-16 mts\\/sec<\\/p>\"}},\"91\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Aerofoil Fans\",\"fd_st_text\":\"<p>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.&nbsp; Recommend for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 7-15 mts\\/sec.<\\/p>\"}},\"92\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"High Pressure Blowers\",\"fd_st_text\":\"<p>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc&nbsp; Normal discharge velocities 15-30 mts\\/sec.<\\/p>\"}}},\"25\":[\"153\"]}}','2018-06-20 09:49:53','2018-06-20 09:49:53','18939c84-a1cf-4f5e-ac43-ee46ab565374'),(278,214,7,1,'en',1,NULL,'{\"typeId\":\"9\",\"authorId\":null,\"title\":\"Enquiries\",\"slug\":\"enquiries\",\"postDate\":1530017561,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}','2018-06-26 12:52:41','2018-06-26 12:52:41','fe5ad301-a591-4391-b3df-ef536988d922'),(279,2,1,1,'en',4,'','{\"typeId\":null,\"authorId\":null,\"title\":\"Welcome to Victoria Fans\",\"slug\":\"homepage\",\"postDate\":1488207921,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"24\":[\"58\"],\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\"}}','2018-06-27 08:27:11','2018-06-27 08:27:11','7b51c361-cf9c-4e3d-8272-5a95f1bcc64c'),(280,2,1,1,'en',5,'','{\"typeId\":null,\"authorId\":null,\"title\":\"Welcome to Victoria Fans\",\"slug\":\"homepage\",\"postDate\":1488207921,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"24\":[\"58\"],\"48\":\"Manufacturers and Trade Suppliers of quality, reliable and robust Industrial Fans for over 30 years.\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\"}}','2018-06-27 08:28:16','2018-06-27 08:28:16','8c12cde2-26a5-4e07-a3a0-2edfa26af3f7'),(281,110,3,1,'en',16,'','{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Mounting Feet\",\"slug\":\"mounting-feet\",\"postDate\":1500974580,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"108\",\"fields\":{\"35\":{\"169\":{\"type\":\"ancilliaryItemText\",\"enabled\":\"1\",\"fields\":{\"itemText\":\"<p>Normally sold as a \\u2018pair\\u2019, the mounting feet sit beneath an axial or a bifurcated fan for horizontal applications. The feet are fabricated from mild steel with a hot dipped galvanized fin