s we have a special acoustic service whereby engineers and consultants can call upon our expertise in selecting the correct method of acoustic treatment to give guaranteed noise levels in hospitals, offices, factories, etc.&nbsp; Simply call our office for more details.<\\/p>\\r\\n<p>Quite the most commonly used silencers are what is known as CYLINDRICAL (STT) and POD (STP) type silencers.&nbsp; The tabulation shows the pressure losses*<\\/p>\\r\\n<p>The length of the silencer is a function of its diameter i.e. 1 x diameter long or 2 x diameter long.&nbsp; Obviously the longer the attenuator the greater the pressure drop and the greater the acoustic performance.<br><\\/p>\\r\\n<p>POD type silencers give better attenuation that CYLINDRICAL type silencers.<\\/p>\"}},\"137\":{\"type\":\"itemTechnicalDrawing\",\"enabled\":\"1\",\"fields\":{\"itemDrawing\":\"\"}},\"136\":{\"type\":\"itemDataTable\",\"enabled\":\"1\",\"fields\":{\"dataTable\":\"{\\\"columns\\\":{\\\"col0\\\":{\\\"heading\\\":\\\"Diameter\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col1\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col2\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col3\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col4\\\":{\\\"heading\\\":\\\"B\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col5\\\":{\\\"heading\\\":\\\"C\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col6\\\":{\\\"heading\\\":\\\"D\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col7\\\":{\\\"heading\\\":\\\"E\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"}},\\\"rows\\\":{\\\"row0\\\":{\\\"col0\\\":\\\"250\\\",\\\"col1\\\":\\\"250\\\",\\\"col2\\\":\\\"375\\\",\\\"col3\\\":\\\"500\\\",\\\"col4\\\":\\\"350\\\",\\\"col5\\\":\\\"294\\\",\\\"col6\\\":\\\"8\\\",\\\"col7\\\":\\\"8\\\"},\\\"row1\\\":{\\\"col0\\\":\\\"315\\\",\\\"col1\\\":\\\"315\\\",\\\"