INSERT INTO `craft_matrixcontent_ancilliaryiteminformation` VALUES (12,135,'en','<p>In both commercial and industrial applications the use of duct mounted silencers to reduce noise emission from fans is become more commonplace as increasing legislation calls for better and more comfortable working environments.</p>\n<p>At Victoria Industrial Fans we have a special acoustic service whereby engineers and consultants can call upon our expertise in selecting the correct method of acoustic treatment to give guaranteed noise levels in hospitals, offices, factories, etc. Simply call our office for more details.</p>\n<p>Quite the most commonly used silencers are what is known as CYLINDRICAL (STT) and POD (STP) type silencers. The tabulation shows the pressure losses*</p>\n<p>The length of the silencer is a function of its diameter i.e. 1 x diameter long or 2 x diameter long. Obviously the longer the attenuator the greater the pressure drop and the greater the acoustic performance.<br /></p>\n<p>POD type silencers give better attenuation that CYLINDRICAL type silencers.</p>',NULL,'2017-07-25 15:27:34','2018-09-03 11:06:18','33596464-4447-4cc0-b91b-188da7ee2ca6'),(13,136,'en',NULL,'{\"columns\":[{\"heading\":\"Diameter\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"250\",\"250\",\"375\",\"500\",\"350\",\"294\",\"8\",\"8\"],[\"315\",\"315\",\"472\",\"630\",\"425\",\"355\",\"8\",\"8\"],[\"355\",\"355\",\"532\",\"710\",\"465\",\"395\",\"8\",\"8\"],[\"400\",\"400\",\"600\",\"800\",\"510\",\"444\",\"8\",\"8\"],[\"450\",\"450\",\"675\",\"900\",\"560\",\"494\",\"8\",\"8\"],[\"500\",\"500\",\"750\",\"1000\",\"660\",\"544\",\"8\",\"8\"],[\"560\",\"560\",\"840\",\"1120\",\"720\",\"604\",\"12\",\"8\"],[\"630\",\"630\",\"945\",\"1260\",\"790\",\"674\",\"12\",\"8\"],[\"710\",\"710\",\"1065\",\"1420\",\"870\",\"754\",\"12\",\"8\"],[\"800\",\"800\",\"1200\",\"1600\",\"1010\",\"858\",\"12\",\"12\"],[\"900\",\"900\",\"1350\",\"1800\",\"1110\",\"980\",\"16\",\"12\"],[\"1000\",\"1000\",\"1500\",\"2000\",\"1210\",\"1080\",\"16\",\"12\"]]}','2017-07-25 15:27:34','2018-09-03 11:06:18','fc145792-5ba6-4eb4-b8f5-26ddfd77231a'),(14,137,'en',NULL,NULL,'2017-07-25 15:27:34','2018-09-03 11:06:18','911312fa-d395-442a-b596-d984b42c0f9c'),(16,142,'en',NULL,NULL,'2017-07-26 10:54:52','2018-09-03 11:06:18','dda497bf-ef36-4f27-9220-88c385d3a27d'),(17,163,'en',NULL,NULL,'2017-11-24 10:15:47','2018-10-22 10:05:42','1ee4357d-62b6-4d1b-ab79-149eed2bded8'),(20,166,'en',NULL,'{\"columns\":[{\"heading\":\"Size\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"F\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"G\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"250\",\"200\",\"255\",\"232\",\"26\",\"60\",\"30\",\"10\"],[\"315\",\"240\",\"310\",\"275\",\"25.5\",\"60\",\"30\",\"10\"],[\"355\",\"250\",\"310\",\"350\",\"40\",\"60\",\"30\",\"10\"],[\"400\",\"300\",\"360\",\"400\",\"40\",\"60\",\"30\",\"10\"],[\"450\",\"295\",\"410\",\"450\",\"40\",\"60\",\"30\",\"10\"],[\"500\",\"360\",\"410\",\"500\",\"40\",\"75\",\"35\",\"10\"],[\"560\",\"350\",\"410\",\"560\",\"60\",\"75\",\"35\",\"10\"],[\"630\",\"390\",\"410\",\"630\",\"60\",\"75\",\"35\",\"10\"],[\"710\",\"435\",\"480\",\"710\",\"50\",\"75\",\"35\",\"14\"],[\"800\",\"480\",\"525\",\"800\",\"50\",\"75\",\"35\",\"14\"],[\"900\",\"535\",\"625\",\"900\",\"50\",\"75\",\"35\",\"14\"],[\"1000\",\"580\",\"700\",\"1000\",\"50\",\"75\",\"35\",\"14\"],[\"1120\",\"670\",\"760\",\"1100\",\"50\",\"75\",\"35\",\"14\"],[\"1250\",\"775\",\"830\",\"1250\",\"50\",\"80\",\"35\",\"14\"]]}','2017-11-24 10:30:34','2018-10-22 10:05:42','959be4b2-c648-4fc2-9c3c-28bbaea481aa'),(21,167,'en',NULL,NULL,'2017-11-24 11:01:52','2018-09-03 11:06:33','a6f321fe-d476-4469-baa1-1300626b7780'),(22,168,'en',NULL,'{\"columns\":[{\"heading\":\"Size\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"F\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"G\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"Load\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"Type 1\",\"37\",\"26\",\"27\",\"67\",\"54\",\"7\",\"8\",\"4 to 54 Kg\"],[\"Type 2\",\"57\",\"46\",\"35\",\"98\",\"76\",\"8\",\"12\",\"23 to 376 Kg\"]]}','2017-11-24 11:01:52','2018-09-03 11:06:33','8ef22dfd-d54e-48ef-b80d-1762b1c31e8a'),(23,169,'en','<p>Normally sold as a ‘pair’, the mounting feet sit beneath an axial or a bifurcated fan for horizontal applications. The feet are fabricated from mild steel with a hot dipped galvanized finish. </p>\n<p>Mounting feet can be supplied in 304 or 316 stainless steel.</p>',NULL,'2017-11-24 11:02:49','2018-10-22 10:05:42','57a1119e-6a8f-4d5e-a6d1-bdd0d5cb77e2'),(24,170,'en','<p>Rubber-in-Compression type supplied as standard. Spring type mountings can be supplied for heavy/slow running fans.</p>',NULL,'2017-11-24 11:03:08','2018-09-03 11:06:33','128d3479-5e56-428d-927c-8077037b218c'),(25,171,'en','<p>Fabricated in Mild Steel with hot dipped Galvanised finish, also supplied in 304 and 316 Stainless Steel.</p>',NULL,'2017-11-24 11:03:32','2018-09-03 11:06:28','ac1b9278-e33f-4b0d-9b6d-0af7ef6eb01e'),(26,172,'en','<p>Normally fitted to the Inlet and Outlet of Axial Fans so as to allow the Fan to be removed from the ductwork system, connections can be supplied for Acoustic and High Temperature applications.</p>',NULL,'2017-11-24 11:03:44','2018-09-03 11:06:23','764c6e22-896d-489d-bb0f-e801ce6af0bf'),(27,173,'en',NULL,NULL,'2017-11-24 11:09:34','2018-09-03 11:06:28','6546182b-682b-4fb5-b7b2-39c3e4f7d25a'),(28,174,'en',NULL,'{\"columns\":[{\"heading\":\"Size\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"F\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"G\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"250\",\"250\",\"344\",\"40\"],[\"315\",\"315\",\"395\",\"40\"],[\"355\",\"355\",\"434\",\"40\"],[\"400\",\"400\",\"484\",\"40\"],[\"450\",\"450\",\"534\",\"40\"],[\"500\",\"500\",\"584\",\"40\"],[\"560\",\"560\",\"644\",\"40\"],[\"630\",\"630\",\"714\",\"40\"],[\"710\",\"710\",\"794\",\"40\"],[\"750\",\"750\",\"858\",\"40\"],[\"800\",\"800\",\"908\",\"50\"],[\"900\",\"900\",\"1033\",\"63\"],[\"1000\",\"1000\",\"1133\",\"63\"],[\"1100\",\"1100\",\"1233\",\"63\"],[\"1250\",\"1250\",\"1378\",\"63\"]]}','2017-11-24 11:09:34','2018-09-03 11:06:28','a43d2b37-0660-4333-8a39-895465740962'),(29,175,'en',NULL,NULL,'2017-11-24 11:13:43','2018-09-03 11:06:23','f22e3bc2-0025-4f11-ad3f-b3aa22d07b97'),(30,176,'en',NULL,'{\"columns\":[{\"heading\":\"Size\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"H\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"J\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"250\",\"260\",\"150\"],[\"315\",\"325\",\"150\"],[\"355\",\"365\",\"150\"],[\"400\",\"410\",\"150\"],[\"450\",\"460\",\"150\"],[\"500\",\"510\",\"150\"],[\"560\",\"570\",\"150\"],[\"630\",\"640\",\"150\"],[\"710\",\"730\",\"150\"],[\"800\",\"830\",\"200\"],[\"900\",\"930\",\"200\"],[\"1000\",\"1030\",\"200\"],[\"1100\",\"1130\",\"200\"],[\"1250\",\"1280\",\"200\"]]}','2017-11-24 11:13:44','2018-09-03 11:06:23','2c2c4207-88d4-4de5-9fa4-8ec366e0e1dc'),(31,187,'en',NULL,NULL,'2017-11-24 14:09:14','2018-09-03 11:06:12','7a228702-3470-4708-ad5a-83ba64778b1b'),(33,189,'en',NULL,'{\"columns\":[{\"heading\":\"Unit Ref\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"RA250\",\"490\",\"310\",\"440\",\"90\",\"330\"],[\"RA315\",\"555\",\"340\",\"490\",\"90\",\"330\"],[\"RA400\\/450\",\"765\",\"460\",\"740\",\"90\",\"330\"],[\"RA500\\/560\",\"995\",\"550\",\"890\",\"120\",\"380\"],[\"RA630\\/710\",\"1115\",\"650\",\"990\",\"120\",\"375\\/410\\/445\"],[\"RA800\",\"1410\",\"750\",\"1090\",\"100\",\"460\\/465\\/540\"],[\"RA900\\/1000\",\"1650\",\"750\",\"1340\",\"80\",\"460\\/465\"]]}','2017-11-24 14:09:14','2018-09-03 11:06:12','36082103-7c71-439e-baff-538db8234366'),(34,213,'en','<p>An Ancillary \'Pack\' would comprise 2 mounting feet, 2 mating flanges, 2 flexible connections and 4 rubber-in compression anti vibration mountings.</p>\n<p>In addition, Victoria Fans can also supply, inlet cones, backdraught shutters and inlet/outlet guards.</p>',NULL,'2018-04-25 11:52:16','2018-09-03 11:06:08','3d74cbdf-73a3-4848-9fb4-8d2f0cfb7b1d');
