llers it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed long cased type in this instance the casing covers the entire length of the motor and impeller and an inspection door is provided essentially for duct mounting where flanges are bolted back and front short cased type the casing covers the impeller track and a portion of the motor projects beyond the end of the flange best installed at the end of a duct or on air conditioning equipment motors in most instances foot mounted tefc iec 600034 1 electric motors are fitted with metric dimensions the motors are selected to cover the peak power absorbed for fan blade pitch angle and speed most standard motors have class f insulation and are suitable for operating at temperatures of up to 50 c 122 f higher temperatures available if required the standard voltages are 220 230 380 380 240 215 and 460 motors can be wound for any voltage and frequency and also for dual voltage the use of standard foot mounted motors of this type guarantees inter changeability in most countries of the world with machines of similar speed kw inverter controlled flameproof single phase 2 speed and company specification motors can always be obtained standard impellers 250 1250mm dia impellers have aerofoil section polypropylene blades fitted into a die cast aluminium hub five different blade angles are available and each blade is individually replaceable in the event of breakage aluminium blades are also available in selected angles special impellers 250 2000mm dia impellers have aerofoil variable pitch aluminium blades fixed into a die cast aluminium hub fractional solidity impellers all sizes of impellers can supplied with varying number of blades to suit the application this has the effect of reducing the static capability of the fan whilst retaining a high efficiency example of coding a typical example of coding is 630 9 35 indicating 630 diameter in mm9 number of blades35 blade angle in degrees extra features available mounting feet flexible connections av mountings mating flanges inlet cones guards back draught shutters special paint finishes external terminal box finish standard fans galvanisedoptional finishes epoxy resin metal spraying '),(17,'field',7,'en',' all long and short cased fans can be supplied with 304 or 316 stainless steel casings '),(17,'slug',0,'en',' axial flow fans '),(17,'title',0,'en',' axial flow fans '),(18,'field',9,'en',' plate mounted axial '),(20,'title',0,'en',' centrifugal fans '),(21,'field',4,'en',''),(21,'field',7,'en',''),(21,'slug',0,'en',' flameproof fans '),(21,'title',0,'en',' flameproof fans for hazardous areas zones 1 2 '),(20,'field',4,'en',' applications engineers must consider the use of centrifugal fans instead of axial fans for some of the following reasons high temperaturelow noise levelsdust fume extracthigh static watergauge types of centrifugal fans there are different types of centrifugal fans covering air volumes from 85 to 100 000m hr and from 25 to 15 000 pa each application requires a fan with different characteristics whether it be the blade design the width of the casing or even the method of drive by way of a guide as to which is the best fan for certain projects we list below information that might assist the potential user paddle blade fans this type of fan is used for the conveying of dust wood and paper refuse cotton fly etc since the blade design prevents build up of waste materials discharge velocities vary dependent upon what is being conveyed in the air stream normally in the region of 7 20 mtrs sec multivane or forward curved fans used for general ventilation purposes not good for dust etc limited pressure characteristics normal discharge velocities 5 13 mts sec backward curved or backward sloping fans non overloading power characteristics suitable for very light dust applications eg clean side of dust collector where a good efficiency is required used for high pressure ventilation systems or where the system resistance could fluctuate normal velocities 9 16 mts sec aerofoil fans the most efficient of all centrifugals fans ideally suited to general ventilation projects where there is no possibility of dust contamination recommend for high pressure ventilation systems or where the system resistance could fluctuate normal discharge velocities 7 15 mts sec high pressure blowers as their name suggests these fans are applied where the requirement is for high velocities eg air curtains refuse conveying etc normal discharge velocities 15 30 mts sec '),(20,'field',7,'en',' since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved any reduction in the requirements could easily overload the motor '),(22,'field',3,'en',''),(22,'slug',0,'en',' conical bifurcated fans '),(22,'title',0,'en',' conical bifurcated '),(23,'field',3,'en',''),(23,'slug',0,'en',' cylindrical bifurcated fans '),(23,'title',0,'en',' cylindrical bifurcated '),(24,'field',3,'en',''),(24,'slug',0,'en',' long cased axial flow fans '),(24,'title',0,'en',' long cased axial '),(25,'field',3,'en',''),(25,'slug',0,'en',' short cased axial flow fans '),(25,'title',0,'en',' short cased axial '),(6,'field',35,'en',''),(28,'field',3,'en',' this range of fans are used to provide ventilation in factories or confined spaces where a fixed installation would not provide enough flexibility these fans are useful in welding and paint fume exhausts grain and hay drying brick cooling steel billet cooling and ships hold ventilation flexible or canvas hose can be fitted to the inlet of the fan to give point extract from remote locations '),(28,'slug',0,'en',' man cooler axial flow fans '),(28,'title',0,'en',' man cooler axial '),(30,'field',3,'en',''),(30,'slug',0,'en',' high pressure blowers '),(30,'title',0,'en',' high pressure centrifugal blowers '),(21,'field',57,'en',''),(32,'field',3,'en',''),(32,'slug',0,'en',' p