INSERT INTO `craft_supertablecontent_fd_st_specialnotes` VALUES (1,48,'en','1. This type of fan can be fitted beneath in LOW PROFILE or VERTICAL JET ROOF COWL as supplied by Victoria Fans.\r\n2. The fans may only be operated when installed as intended and when safety is ensured.','2017-02-28 17:15:35','2019-08-15 13:37:25','e15118c3-8e39-47c4-82a0-43b43caf6778'),(2,121,'en','Flange Drillings to BS EN ISO13351 (E)','2017-07-25 10:11:38','2019-08-15 13:38:52','0166b143-a4d7-427d-9df9-ec30c05f49a0'),(3,146,'en','Flange drillings to BS EN ISO 13351 2009(E)','2017-07-26 12:56:28','2019-08-15 13:27:11','04d4f732-565e-47f0-b060-57f9e50ead00');
